import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <div className="container">
        <table style={{margin: 20+'px'}} className="table table-striped table-bordered">
          <thead>
            <tr>
              <th>Nama</th><th>Alamat</th><th>Hobi</th>
            </tr>
          </thead>
        </table>
      </div>        
    </div>
  );
}

export default App;
